import React from 'react';

const UrlList = ({ urls }) => {
    return (
        <div>
            <h2>Shortened URLs</h2>
            <ul>
                {urls.map((url, index) => (
                    <li key={index}>
                        <a href={url.shortened} target="_blank" rel="noopener noreferrer">
                            {url.shortened}
                        </a> - {url.original}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default UrlList;
